import React from 'react';

class Form extends React.Component {

  render() {
    const { value } = this.props;
    return (
      <form>
        <label htmlFor="valueInput">
          Valor:
          <input
            data-testid="value-input"
            type="number"
            value={ value }
          />
        </label>
      </form>
    );
  }
}

export default Form;
